import React from 'react';
// Import Icons
import { FaSearch, FaEnvelope, FaBell } from 'react-icons/fa';
import { FiSettings } from 'react-icons/fi';
// Import component
import MyIcons from './MyIcons';
// Import logo image
import LogoUrl from '../images/logo.png';
// Import icon image
// import ImageUrl from '../images/xxxx.png';

// Dummy component
const MyHeader = props => {
	return (
		<header style={styles.myHeader}>
			<div style={styles.left}>
				{/* <img src={LogoUrl} alt="" style /> */}
				<img src={LogoUrl} alt="Company Logo" style={styles.logo} />
				<h1>Brand</h1>
			</div>
			<div style={styles.searchCont}>
				<input type="text" placeholder="Search" style={styles.inputwithIcon} />
				<span style={styles.inputIcon}>
					<FaSearch />
				</span>
			</div>
			<div style={styles.rightSide}>
				<button style={styles.rightIcons}>
					<FiSettings />
				</button>
				<button style={styles.rightIcons}>
					<FaEnvelope />
				</button>
				<button style={styles.rightIcons}>
					<FaBell />
				</button>
				{/* <MyIcons IconImg={ImageUrl} ImageAlt="Icon of user" /> */}
			</div>
		</header>
	);
};

// Export
export default MyHeader;

// Styling with CSS-in-JS
const styles = {
	myHeader: {
		backgroundColor: 'black',
		padding: '10px',
		color: 'grey',
		display: 'flex',
		flexDirection: 'row',
		justifyContent: 'space-between',
		alignItems: 'center',
		boxShadow: '1px 6px 6px 1px grey',
	},
	left: {
		margin: 0,
		display: 'flex',
		flexDirection: 'row',
		justifyContent: 'space-between',
		alignItems: 'center',
	},
	logo: {
		borderRadius: '50%',
		height: '100px',
		marginRight: '20px',
		padding: '10px',
		backgroundColor: 'white',
		alignItems: 'center',
	},
	searchCont: {
		border: '1px solid grey',
		display: 'flex',
		flexDirection: 'row',
		borderRadius: '2px',
		width: '40%',
	},
	inputIcon: {
		backgroundColor: '#ddd',
		padding: '10px',
		display: 'flex',
		alignItems: 'center',
		fontSize: '1rem',
		cursor: 'pointer',
	},
	inputwithIcon: {
		border: 'none',
		flex: '1',
		padding: '10px',
	},
	rightSide: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		marginRight: '10px',
	},
	rightIcons: {
		backgroundColor: 'black',
		color: 'grey',
		border: 'none',
		fontSize: '1.5rem',
	},
};
